import React from 'react';
import {NavLink} from 'react-router-dom';
import errorimg from '../Images/not_found.PNG';
import Same from './Same';

const About=()=>{
    return(
        <>
        <Same
        imgsrc ={errorimg} position="center"
        text="404... Page not found" 
        />
        </>
    )
}
export default About;
